INSERT INTO `article` (`article-id`, `topic-article`, `summary-article`, `text-article`, `date-article`, `image-article`) VALUES
(1, 'Call for Abstracts: Nordic Roaster Forum 2019 Oslo', 'Nordic Roaster Forum theme comes off the heels of 2018 forum on sustainability As we learned, su...', 'Nordic Roaster Forum theme comes off the heels of 2018 forum on sustainability. As we learned, sustainability is a wide ranging and complex topic with far-reaching consequences. Each of us are contemplating what we can do to minimize our impact on the environment, while simultaneously creating more sustainable models for running our coffee businesses.\r\n\r\nThe objective for this year’s forum is to explore ‘climate change adaptation in coffee’. How are coffee professionals across the coffee supply chain addressing and tackling climate change? If you are someone that has a working approach to, or you are researching this topic, we would love to hear from you.\r\n\r\nPlease submit a 250-500 word abstract for a 30-minute oral presentation about your work on climate change adaptation in coffee. Send your submission to melanie.leeson@gmail.com by June 30th, 2019.\r\n\r\nIn line with this year’s forum theme, the Nordic Roaster Competition coffees will be leaf rust resistant hybrid cultiva', '2019-08-10', );
INSERT INTO `article` (`article-id`, `topic-article`, `summary-article`, `text-article`, `date-article`, `image-article`) VALUES
(2, 'NRF 2019 Speakers', 'Greg Meenahan is the Partnership Director for World Coffee Research and is coordinating the indus...', 'Greg Meenahan is the Partnership Director for World Coffee Research and is coordinating the industry global, financial support for this pre-competitive agricultural research and development effort. His communications and fundraising career has been focused on removing barriers to human potential and providing the tools people need to achieve economic stability. Because some of the most vulnerable people on the planet grow one of the most vulnerable crops on the planet, it became clear that agricultural research and development could lift millions out of poverty and could prevent many from falling into it. In his keynote presentation, Boosting Farm Profitability at a Time of Record Low Prices, Greg talks about global coffee prices, which are at their lowest levels in more than a decade, and how this endangers coffee producers and entire origins. ', '2019-08-08', );
INSERT INTO `article` (`article-id`, `topic-article`, `summary-article`, `text-article`, `date-article`, `image-article`) VALUES
(3, 'Nordic Roaster Forum 2019 Program', 'The objective for this year forum is to explore climate change adaptation in coffee. How are ...', 'Nordic Roaster Forum theme comes off the heels of 2018 forum on sustainability. As we learned, sustainability is a wide ranging and complex topic with far-reaching consequences. Each of us are contemplating what we can do to minimize our impact on the environment, while simultaneously creating more sustainable models for running our coffee businesses.\r\n\r\nThe objective for this year’s forum is to explore ‘climate change adaptation in coffee’. How are coffee professionals across the coffee supply chain addressing and tackling climate change?\r\n\r\nIn line with this year’s forum theme, the Nordic Roaster Competition coffees will be leaf rust resistant hybrid cultivars. We are very much looking forward to both cupping the competitors’ roast approaches to these cultivars, along with discussing our respective perceptions about the quality and cup profiles of hybrids.', '2019-07-10', );
INSERT INTO `article` (`article-id`, `topic-article`, `summary-article`, `text-article`, `date-article`, `image-article`) VALUES
(4, 'Nordic Roaster 2019 Competition : Participants.', 'The competition is open only to 10 roaster...\r\nAny roaster that is registered as a business and who ', 'The competition is open only to 10 roasters.\r\nAny roaster that is registered as a business and who is selling roasted coffee roasted by themselves, and is located within the Nordic countries, can apply for participation. In Other words, the competition is for roasters located in the Nordic countries only.\r\n\r\nThe competition fee is € 780,- (euro) and includes one attendee ticket to the Nordic Roaster Forum.\r\n\r\nSince it is a Nordic Roaster Competition only applying roasters located in the  Nordic countries will be granted a spot in the competition.', '2019-05-15', );
INSERT INTO `article` (`article-id`, `topic-article`, `summary-article`, `text-article`, `date-article`, `image-article`) VALUES
(5, 'Nordic Roaster Competition Rules 2018', 'The 2019 Nordic Roaster competition will be held at the Nordic Roaster event in Oslo, Norway on t...', 'The 2019 Nordic Roaster competition will be held at the Nordic Roaster event in Oslo, Norway on the 3rd to the 5th of October.\r\n\r\nThe aim is to reward the best overall roaster with the title “Nordic Roaster 2019”. The title is for the winner to use during its reigning year and can be used only by the winner.', '2019-08-06', );
INSERT INTO `article` (`article-id`, `topic-article`, `summary-article`, `text-article`, `date-article`, `image-article`) VALUES
(6, 'Leaf rust resistant hybrid cultivars', 'In this category each roaster must submit 10 kg of roasted coffee beans of any resistant hybrid c...', 'In this category each roaster must submit 10 kg of roasted coffee beans of any resistant hybrid cultivar. The coffee can be processed in any way. For example washed, natural processed coffees, pulped natural or honey processed coffees where the coffee has been dried in contact with mucilage or pulp are all allowed. Additional flavour additives are not allowed. The coffee can come from any origin but must be a single origin coffee. However it can be a blend of coffees from smallholder farmers within one country for example a cooperative coffee. Each roaster must submit 10 kilos of roasted coffee beans for the competition packed in 100g bags.\r\n\r\nSee below for a list of allowed resistant hybrid cultivars. If a roaster wants to compete with  a resistant hybrid cultivar that is not on the list, please contact jdn@vaa.dk with the name and origin of the cultivar to apply for approval.', '2017-08-07', );
INSERT INTO `article` (`article-id`, `topic-article`, `summary-article`, `text-article`, `date-article`, `image-article`) VALUES
(7, 'Evaluation', 'The coffees will be evaluated by the attendees at the 2019 Nordic Roaster Forum. The coffees will...', 'The coffees will be evaluated by the attendees at the 2019 Nordic Roaster Forum.\r\n\r\nThe coffees will be evaluated by the cup-tasting method and will be tasted blind, meaning the attendees will not know which coffees they are tasting and from which roaster they were submitted.\r\n\r\nThere will be one cupping on the Friday and one on the Saturday.\r\n\r\nThe cupping brewing ratio will be 60 grams to 1000 grams of water. The extraction % will be set by the Nordic Roaster Forum organizing committee according to the grinder used.  As an example we have previously used a Mahlkönig EK 43 grinder and the cupping strength was  approximately TDS 1,1 – 1,2 yielding an extraction % of 19,5 – 21,5.', '2019-04-14', );
INSERT INTO `article` (`article-id`, `topic-article`, `summary-article`, `text-article`, `date-article`, `image-article`) VALUES
(8, 'Criterias for submitting valid scores', 'The main criterias in order to be an evaluator in each round is that 10 scores must be submitted ...', 'The main criterias in order to be an evaluator in each round is that 10 scores must be submitted and they all need to be above 80 points.\r\n\r\nIf an evaluator has only submitted 9 scores or less above 80 points in one category the evaluator is not eligible to score the entire round and all her / his scores are removed from the round. The evaluator can however score in the second round / category because the average score is calculated and each roaster will have the same amount of scores in each round. In other words, evaluators who have scored one or more coffees under 80 pionts will be removed from the final evalutaion of all coffees within the category / round.\r\nEvaluators who have submitted less than 10 scores will also be removed from the final evaluation of all coffees within the category / round.\r\nIf a score is submitted after the cupping session is closed, the score will not be counted in the competition. ', '2019-08-05', );

